import React from 'react'

import styled from 'styled-components'

const Real = styled.img(props => ({
  position: 'absolute',
}))

const Vector = styled.img(props => ({
  position: 'relative',
  top: 0,
  left: 0,

  '&:active': {
    opacity: 0
  }
}))

const picStyles = {
  width: '250px',
  height: '250px',
  backgroundColor: 'red',
  border: 'none',
  outline: 'none',
  // borderRadius: '50%',
}


export default function TwoFace (props) {
  return (
    <>
      <Real style={picStyles} src={require('./real.png')} />
      <Vector style={picStyles} src={require('./vec-t.png')} />
    </>
  )
}
